  this.online = false,
  this.status,
  this.msg}
  }


  render(){
    <div className = ' contact'>
      <img className = 'avatar' src = {this.avatar}></img>
    <div className= 'container'>
      <h4 className= 'name' >{this.name}</h4>
      <div className = 'status'>
        {this.status}
        <p className = 'status-text'>{this.msg}</p> 
      </div>
    </div>
  </div> 

  }
}





